import React from 'react';
import { View, StyleSheet } from 'react-native';
import Banner from './Banner';

const Home = () => {
    return (
        <View style={styles.c}>
            <Banner />
        </View>
    );
}

const styles = StyleSheet.create({
    homeContainer: {
        width: '100vw',
        minHeight: '20vh',
        backgroundColor: "#808080"
    }
})

export default Home;
